import React from 'react';
import './App.css';
import Navbar from './Navbar';
import Fronet from './Fronet';
import Events from './Events';
import About from './About';


function App() {
  return (
    <div className="App">
     <Navbar></Navbar>
     <Fronet></Fronet>
     <Events></Events>
     <About></About>
    </div>
  );
}
export default App;
